The Care and Training of your Pet Rock

Original 1975 Manual Booklet from Rock Bottom Productions

Remember the Pet Rock craze of the 1970's, well here's the original manual from the silly yet successful novelty item that made Gary Dahl a millionaire in 6 months' time. It is in a PDF eBook with searchable text and color graphics. Also, there is an additional file with photos and certificates from the Pet Rock craze. The photos are of the original Pet Rock, but I cannot vouch for the authorship of the certificates. Make sure your rock has all the legal paperwork!

A Must-Have for owners of Pet Rocks, and those aspiring to do so. The easiest pet I've ever owned! 


